svg.script:

        // Get the theme from localStorage or default to 'light'
        var theme = localStorage.theme || 'light';

        // Set the fill color based on the theme
        function setFillColor() {
			var themeColor = (theme === 'dark') ? 'white' : 'black';
			var dynamicFillElements = document.getElementsByClassName('dynamic-fill');
			var dynamicFill2Elements = document.getElementsByClassName('dynamic-fill-2');

			// Set color for elements with class 'dynamic-fill'
			for (var i = 0; i < dynamicFillElements.length; i++) {
				dynamicFillElements[i].setAttribute('fill', themeColor);
			}

			// Set color for elements with class 'dynamic-fill-2'
			var dynamicFill2Color = (theme === 'dark') ? '#101827' : '#FFFFFF';
			for (var j = 0; j < dynamicFill2Elements.length; j++) {
				dynamicFill2Elements[j].setAttribute('fill', dynamicFill2Color);
			}
		}

        // Call the function when the SVG is loaded
        window.addEventListener('DOMContentLoaded', setFillColor);

        // Listen for changes in the localStorage and update the theme
        window.addEventListener('storage', function (event) {
            if (event.key === 'theme') {
                theme = localStorage.theme || 'light';
                setFillColor();
            }
        });
